import React from 'react';
import Widget from '../dashboard/Widget';

function Transaction(props) {
    return (
        <>
            <div className='dash'> 
                <div className='widgets'>
                    <Widget redirect={'/transaction'} type='user' />
                    <Widget type='order' />
                </div>
                <div className='widgets'>
                    <Widget type='earning' />
                    <Widget type='balance' />
                    <Widget type='earning' />
                    <Widget type='balance' />
                </div>
            </div> 
        </>
    );
}

export default Transaction;
